Text:
To the Border Patrol:  WE HAVE YOUR BACK! 

@CBP #BorderPatrol 

Please watch and SHARE on Twitter if you agree! https://t.co/8cyLIxiB3G

@foxandfriends If you come from some other place, we send you back to Mexico, you sit in Mexico, make your application, you can’t come here until your hearing which is 3 or 4 years down the road.  

It would all stop overnight. 

Nobody’s going pay a bunch of money to sit in Mexico for 5 years.
